    const toAttribute = () => {
        const createdIntData = new FormData()
        createdIntData.append("intAttributeId",attributeData.attributeData.id)
        newUserIntAttribute(createdIntData)
        getUserInterest()
        getUserInterest()
        getUserInterest()
    }






    return (

        <div className=" pointercard shadow-xss rounded-xxl border-0 text-center p-2 mb-2 d-flex">
            <div className="card-body p-0 pointer" onClick={() => toAttribute()}>
                <h4 className="fw-700 text-grey-700 font-xssss"> {attributeData.attributeData.attributeName}
                </h4>

            </div>
        </div>


    );

}

